import './controleMensal.css';
import React, { useEffect, useState } from 'react';

const ControleMensal = () => {

    const [loading, setLoading] = useState(false);

    if (loading) {
        return <p>Loading...</p>;
    }

  return (
    <div class="container">
        <div class="row linha_mensal">
            <div class="col-6">
            One of two columns
            </div>
            <div class="col-6">
            One of three columns
            </div>
        </div>
        <div class="row linha_mensal">
            <div class="col-6">
            One of three columns
            </div>
            <div class="col-6">
            One of three columns
            </div>
        </div>
    </div>
  );

};
export default ControleMensal;
